import './App.css';
import Navigation from "./components/Navigation";
import HorizontalDivider from "./components/HorizontalDivider";
import Footer from "./components/Footer";
import MenuContainer from "./components/MenuContainer";
import AllSectionsContainer from "./components/AllSectionsContainer";
import PageTitle from "./components/PageTitle";


function App() {
  return (
    <div className="App">
        <header className="header">
          <Navigation
              icons={["fa-solid fa-house", "fa-solid fa-bars"]}
              links={["#", "#"]}
              linkText={["Home", "Menu"]}
          />
          <PageTitle title="Main Menu"/>
      </header>
      <main>
        <div className="total-container">
          <MenuContainer
                icons={["fa-solid fa-angles-left", "fa-solid fa-landmark-flag"]}
                links={["#", "#"]}
                linkText={["Back", "Test"]}
          />
          <HorizontalDivider/>
          <AllSectionsContainer/>
        </div>
      </main>
    <Footer content="&copy; 2023" />
    </div>
  );
}

export default App;
